import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";
import { AutoAwesome, CreateRounded } from "@mui/icons-material";
import TextInput from "../Input/TextInput";
import Button from "../buttons/button";
import { CreatePost, GenerateImageFromPrompt } from "../../api";

const Form = styled.div`
  flex: 1;
  padding: 16px 20px;
  display: flex;
  flex-direction: column;
  gap: 9%;
  justify-content: center;
`;

const Top = styled.div`
  display: flex;
  flex-direction: column;
  gap: 6px;
`;

const Title = styled.div`
  font-size: 28px;
  font-weight: 500;
  color: ${({ theme }) => theme.text_primary};
`;

const Desc = styled.div`
  font-size: 17px;
  font-weight: 400;
  color: ${({ theme }) => theme.text_secondary};
`;

const Body = styled.div`
  display: flex;
  flex-direction: column;
  gap: 18px;
  font-size: 12px;
  font-weight: 400;
  color: ${({ theme }) => theme.text_secondary};
`;

const Actions = styled.div`
  display: flex;
  flex: 1;
  gap: 8px;
`;

const GenerateImage = ({
  post,
  setPost,
  createPostLoading,
  setcreatePostLoading,
  generateImageLoading,
  setGenerateImageLoading,
}) => {

  const navigate = useNavigate();

  // const [post, setPost] = useState({
  //   name: "",
  //   prompt: "",
  //   photo: "",
  // });
  // const [createPostLoading, setcreatePostLoading] = useState(false);
  // const [generateImageLoading, setGenerateImageLoading] = useState(false);
  const [error, setError] = useState("");

  const generateImage = async () => {
    setGenerateImageLoading(true);
    setError("");
    

    try {
      
      const res = await GenerateImageFromPrompt({ inputs: post.prompt });
      setPost((prevPost) => ({
        ...prevPost,
        photo: res?.data?.photoUrl || "",
      }));
    } catch (error) {
      setError(error?.response?.data?.message || error.message);
    } finally {
      setGenerateImageLoading(false);
    }
  };

  const createPost = async () => {
    setcreatePostLoading(true);
    setError("");

    try {
      await CreatePost(post);
      navigate("/");
    } catch (error) {
      setError(error?.response?.data?.message || error.message);
    } finally {
      setcreatePostLoading(false);
    }
  };

  return (
    <Form>
      <Top>
        <Title>Generate Image with prompt</Title>
        <Desc>Write your prompt according to the image you want to generate!</Desc>
      </Top>
      <Body>
        <TextInput
          label="Author"
          placeholder="Enter your name"
          name="name"
          value={post.name}
          handelChange={(e) => setPost({ ...post, name: e.target.value })}
        />
        <TextInput
          label="Image Prompt"
          placeholder="Write a detailed prompt about the image"
          name="prompt"
          textArea
          rows="8"
          value={post.prompt}
          handelChange={(e) => setPost({ ...post, prompt: e.target.value })}
        />
        {error && <div style={{ color: "red" }}>{error}</div>}
        * You can post the AI Generated Image to showcase in the community!
      </Body>
      <Actions>
        <Button
          text="Generate Image"
          leftIcon={<AutoAwesome />}
          flex
          isLoading={generateImageLoading}
          isDisabled={post.prompt.trim() === ""}
          onClick={generateImage}
        />
        <Button
          text="Post Image"
          leftIcon={<CreateRounded />}
          type="secondary"
          flex
          isDisabled={post.name.trim() === "" || post.photo === "" || post.prompt.trim() === ""}
          isLoading={createPostLoading}
          onClick={createPost}
        />
    
      </Actions>
    </Form>
    
  );
};

export default GenerateImage;
